import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        date={props.item.expenses[0].date}
        title={props.item.expenses[0].title}
        amount={props.item.expenses[0].amount}
      />
      <ExpenseItem
        date={props.item.expenses[1].date}
        title={props.item.expenses[1].title}
        amount={props.item.expenses[1].amount}
      />
      <ExpenseItem
        date={props.item.expenses[2].date}
        title={props.item.expenses[2].title}
        amount={props.item.expenses[2].amount}
      />
      <ExpenseItem
        date={props.item.expenses[3].date}
        title={props.item.expenses[3].title}
        amount={props.item.expenses[3].amount}
      />
    </div>
  );
}

export default Expenses;
